  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Fort Peck NWR
  and the easement refuges outlines Refuge accomplishments from September through
  December of 1953. The report begins by summarizing the weather conditions and water
  conditions during this period. Wildlife- including migratory birds, upland game
  birds, big game animals, furbearers, predators, rodents, mammals, raptors, fish,
  and disease- is also covered. The Refuge development and maintenance section discusses
  physical developments and plantings. Resource management is outlined; topics include
  grazing. A progress report on field investigations and applied research is also
  provided. The public relations section of the report describes recreational uses,
  Refuge visitors, Refuge participation, hunting, fishing, and violations. Items of
  interest, N-R forms, and photographs are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
